import React from 'react';


const Home = () => {
    return (
      <header className="header">
        <div className="logo">My Blog</div>
        <nav>
          <ul>
            <li><a href="/">Home</a></li>
            <li><a href="/blog">Blog</a></li>
            <li><a href="/about">About</a></li>
          </ul>
        </nav>
      </header>
    );
  }

export default Home;
